import React from 'react';

const Notfound = () => {
    return (
        <div>
        <div id='banner' className='my-5 pt-5 bg-gray-200 flex justify-center items-center py-10'>
           <h1 className='text-3xl font-semibold text-green-500 uppercase'> Not found 404</h1>
        </div>
            
        </div>
    );
};

export default Notfound;
